package zip;

import java.io.ByteArrayOutputStream;
import java.io.File;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.InputStream;
import java.io.OutputStream;
import java.util.Base64;

public class TextUrl {

	public static void main(String[] args) {
		File file = new File("E:\\demo.zip");
		try {
			String string = Base64.getEncoder().encodeToString(file2byte(file));
			String str = "";
			System.out.println(string);
			System.out.println(str);
			System.out.println(str.equals(string));
			System.out.println(string.length() + "--" + str.length());
			byte[] decode = Base64.getDecoder().decode(str);
			for (int i = 0; i < decode.length; i++) {
				if (decode[i] < 0) {
					decode[i] += 256;
				}
			}
			OutputStream out = new FileOutputStream(new File("E:\\aa.zip"));
			out.write(decode);
			out.close();
		} catch (Exception e) {
			e.printStackTrace();
		}
	}

	@SuppressWarnings("resource")
	private static byte[] file2byte(File file) throws Exception {
		InputStream inputStream = new FileInputStream(file);
		ByteArrayOutputStream baos = new ByteArrayOutputStream();
		byte[] buffer = new byte[1024];
		int len = 0;
		while ((len = inputStream.read(buffer)) != -1) {
			baos.write(buffer, 0, len);
		}
		return baos.toByteArray();
	}

}
